import React, { useState } from "react";

const Dog = (props) => {
  return (
    <article className="" type="button">
      <img src={props.dogs.url} alt={props.dogs.name} />
      <div className="nameGender">
        <h2 className="">{props.dogs.name}</h2>
        <div className="gender">
          {props.dogs.gender === "Female" ? (
            <i class="fas fa-venus"></i>
          ) : (
            <i class="fas fa-mars"></i>
          )}
        </div>
      </div>
    </article>
  );
};

export default Dog;
